var tokenize = function (str, delimiter) {
    delimiter = delimiter || '&';
    var pairs = str.split(delimiter);
    var tokens = {};
    for (var i = 0, ii = pairs.length; i < ii; i++) {
        var pair = pairs[i].split('=');
        tokens[pair[0]] = pair[1];
    }
    return tokens;
};

